import Layout from '../components/Layout';
import Link from 'next/link';


const Index = () => {
    return (
        <Layout>
        <div id="container-main-page">

            <div id="image-main-page">
                    <img src="/LP2.jpg" width="1068" height="1920" /> 
            </div>

        </div>
        </Layout>
    );
};

export default Index;
